const honeyTypes = ['akác', 'gyógy', 'hárs', 'virág', 'repce'];

import React from 'react';
import { makeStyles } from '@mui/styles';
import { Grid, Typography, Card, CardActionArea, CardMedia, CardContent } from '@mui/material';

const products = [
  {
    id: 1,
    name: 'Product 1',
    image: 'https://via.placeholder.com/300x200.png?text=Product+1',
    price: 19.99,
  },
  {
    id: 2,
    name: 'Product 2',
    image: 'https://via.placeholder.com/300x200.png?text=Product+2',
    price: 29.99,
  },
  {
    id: 3,
    name: 'Product 3',
    image: 'https://via.placeholder.com/300x200.png?text=Product+3',
    price: 39.99,
  },
  {
    id: 4,
    name: 'Product 4',
    image: 'https://via.placeholder.com/300x200.png?text=Product+4',
    price: 49.99,
  },
];

const useStyles = makeStyles((theme) => ({
  root: {
    marginTop: theme.spacing(4),
  },
  card: {
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
  },
  cardMedia: {
    paddingTop: '56.25%', // 16:9
  },
  cardContent: {
    flexGrow: 1,
  },
}));

const ProductListPage = () => {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Typography variant="h4" gutterBottom>
        Products
      </Typography>
      <Grid container spacing={4}>
        {products.map((product) => (
          <Grid item key={product.id} xs={12} sm={6} md={4}>
            <Card className={classes.card}>
              <CardActionArea>
                <CardMedia
                  className={classes.cardMedia}
                  image={product.image}
                  title={product.name}
                />
                <CardContent className={classes.cardContent}>
                  <Typography gutterBottom variant="h5" component="h2">
                    {product.name}
                  </Typography>
                  <Typography>
                    ${product.price}
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </Grid>
        ))}
      </Grid>
    </div>
  );
};

  export default List;
